import logo from './logo.svg';
import './mainView.css';
import React, {Component} from "react";
import TextField from '@mui/material/TextField';
import TopMenuBar from '../components/TopMenuBar';
import TableGastos from '../components/TableGastos';
import {Button, ButtonGroup, Container, Table} from 'reactstrap';
import {Link} from 'react-router-dom';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
} from 'react-router-dom';

class MainView extends Component {
    state = {
        gastos: []
    };

    async componentDidMount() {
        const response = await fetch('/api');
        const body = await response.json();
        this.setState({gastos: body});
    }

    render() {
        const {gastos} = this.state;
        return (
            <div className="defaultBackground mainViewBackground">
                <div className="PageHeader">
                    <TopMenuBar/>
                </div>
                <div className="outside">
                    <div className="TableGastos">
                        <Button className="createButton filledButton" variant="contained">
                            Cadastrar novo gasto
                        </Button>
                        <TableGastos/>
                    </div>
                </div>
            </div>
        );
    }
}

export default MainView;
